// data.js
export const pollData = [
  {
    id: 1,
    title: "Favorite Color",
    description: "Vote for your favorite color.",
    options: [
      { id: 1, option: "Red", votes: 10 },
      { id: 2, option: "Blue", votes: 5 },
      { id: 3, option: "Green", votes: 8 },
    ],
  },
  {
    id: 2,
    title: "Best Programming Language",
    description: "Vote for your favorite programming language.",
    options: [
      { id: 1, option: "JavaScript", votes: 20 },
      { id: 2, option: "Python", votes: 15 },
      { id: 3, option: "Java", votes: 5 },
    ],
  },
  {
    id: 3,
    title: "Favorite Animal",
    description: "Vote for your favorite animal.",
    options: [
      { id: 1, option: "Cat", votes: 12 },
      { id: 2, option: "Dog", votes: 18 },
      { id: 3, option: "Bird", votes: 5 },
    ],
  },
];
